router6.get("/users", requireAuth, requireAdmin, async (req, res) => {
  try {
    const { page = "1", limit = "20", role, search } = req.query;
    const skip2 = (parseInt(page) - 1) * parseInt(limit);
    const where = {};
    if (role)
      where.role = role;
    if (search) {
      where.OR = [
        { name: { contains: search, mode: "insensitive" } },
        { email: { contains: search, mode: "insensitive" } }
      ];
    }
    const [users, total] = await Promise.all([
      prisma_default.user.findMany({
        where,
        select: {
          id: true,
          name: true,
          email: true,
          role: true,
          createdAt: true,
          serviceProvider: { select: { id: true, isVerified: true } }
        },
        skip: skip2,
        take: parseInt(limit),
        orderBy: { createdAt: "desc" }
      }),
      prisma_default.user.count({ where })
    ]);
    res.json({
      users,
      pagination: {
        page: parseInt(page),
        limit: parseInt(limit),
        total,
        pages: Math.ceil(total / parseInt(limit))
      }
    });
  } catch (error48) {
    console.error("Error fetching users:", error48);
    res.status(500).json({ error: "Failed to fetch users" });
  }
});
